function Tsyeri(props)
{
  return(
    <div className='Tsyeri'>
      <h1>I am {props.user.url} and i have {props.user.alt} years old</h1>
    </div>
  );
}
function Eri(props)
{
  return(
    <Tsyeri user={props.author}/>
  )
}

function Uni()
{
  return (
    <div className="Uni">
        <p>
        forear {new Date().toLocaleTimeString()}
        </p>
    </div>
  );
}
const b={url:"antonio",alt:21}
const a=ReactDOM.createRoot(document.getElementById('as'))
const root = ReactDOM.createRoot(document.getElementById('root'));
window.setInterval(() => {
  a.render(
    <React.StrictMode>
      <Eri author={b}/>
    </React.StrictMode>
  )
},1000);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
)

